const INITIAL_STATE = {
  rows: 5,
  cols: 5,
  selected_rows: 5,
  selected_cols: 5
};

const settingsReducer = (state = INITIAL_STATE, action)  => {
  alert(`CALL ${action.type}`);
  switch (action.type) {
    case 'RESET':
      return { ...state, rows: action.rows, cols:action.cols,selected_rows: 5, selected_cols: 5 };

    //alert(`row ${row.target.value}`);
    default: return state;
  }
}

export default settingsReducer;
